import React from 'react'
import Link from 'next/link'
import { navbarLinks as link } from '../../NavigationMenu'
import { FiAirplay } from 'react-icons/fi'
import { FiAlignRight } from 'react-icons/fi'


function Minnav({ isOpen, toggle }) {


    return (

        <div className={isOpen ? " text-center items-center minnav" : "hidden"} >
            <div className="h-40 text-white font-mono space-y-2">
                <div className="">
                    <ul>
                        <li>searching for car</li>
                    </ul>
                </div>

                <div className=" h-[0.5] bg-[#d6d6d8] "></div>

                {link.map((nav) => {
                    const { id, text, path } = nav;
                    return (

                        <h1 as={`/${nav.path}`} href='/[pages]' onClick={toggle}>

                            <a>{text}</a>
                        </h1>

                    )
                })}


            </div>



            <div className="h-6 bg-black md:hidden border-b-[1px]" style={{
                borderTopRightRadius: '30px',
                borderTopLeftRadius: '30px',
            }}
            >

            </div>
        </div>



    )
}

export default Minnav
